import React from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';

export default function MenuReponsive() {
    return (
        <Menu mode='inline'>
            <Menu.Item key={0} style={{borderRight: 'none'}}>
                <Link to="/about">Account</Link>
            </Menu.Item>
            <Menu.Item key={1}>
                <Link to="/about">Setting</Link>
            </Menu.Item>

            <Menu.Item key={2}>
                <Link to="/about">Logout</Link>
            </Menu.Item>
        </Menu>
    );
}
